// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMBlIData(char *Buffer)
{
    memcpy(Buffer, &JMBlIL0[1], JMBlIL0[0] << 2);
    Buffer += (JMBlIL0[0] << 2);

    memcpy(Buffer, &JMBlIL1[1], JMBlIL1[0] << 2);
    Buffer += (JMBlIL1[0] << 2);

    memcpy(Buffer, &JMBlIL2[1], JMBlIL2[0] << 2);
    Buffer += (JMBlIL2[0] << 2);

    memcpy(Buffer, &JMBlIL3[1], JMBlIL3[0] << 2);
    Buffer += (JMBlIL3[0] << 2);

    memcpy(Buffer, &JMBlIL4[1], JMBlIL4[0] << 2);
    Buffer += (JMBlIL4[0] << 2);

    memcpy(Buffer, &JMBlIL5[1], JMBlIL5[0] << 2);
    Buffer += (JMBlIL5[0] << 2);

    memcpy(Buffer, &JMBlIB[1], JMBlIB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMBlIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMBlIData(void)
{
    remove(JMBlIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMBlIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMBlIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMBlIName)) return "";
    #endif

    if (!(han = fopen(JMBlIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMBlIData);

    num = fwrite(&JMBlIL0[1], 4, JMBlIL0[0], han);
    if (num != JMBlIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMBlIL1[1], 4, JMBlIL1[0], han);
    if (num != JMBlIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMBlIL2[1], 4, JMBlIL2[0], han);
    if (num != JMBlIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMBlIL3[1], 4, JMBlIL3[0], han);
    if (num != JMBlIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMBlIL4[1], 4, JMBlIL4[0], han);
    if (num != JMBlIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMBlIL5[1], 4, JMBlIL5[0], han);
    if (num != JMBlIL5[0]) {fclose(han); return "";}

    num = fwrite(&JMBlIB[1], 1, JMBlIB[0], han);
    if (num != JMBlIB[0]) {fclose(han); return "";}

    fclose(han);
    return JMBlIName;
}

